const logo = 'data:image/png;base64,'

export async function createTool({ fabric })
{
    let browser = typeof process === 'undefined' || process.browser,
        module = browser ? './index.mjs' : './empty.mjs',
        file = browser ? 'code' : 'node',

        fontFamily = 'Archive',

        DEFAULT = {
            text: 'NetAggregator PRO',
            logoBackgroundColor: 'rgba(255,255,255,1)',
            logoBackgroundTransparent: false,
            logo,

            title: {
                text: 'NetAggregator PRO',
                fontFamily: 'Archive',
                fontStyle: 'normal',
                fontWeight: 500,
                fontSize: 32,
                backgroundColor: 'rgba(50,120,180,1)',
                color: 'rgba(255,255,255,1)'
            }
        },

        { setControls } = await import(/* webpackChunkName: "toolkit" */ `${module}`).then(m => m.default || m),
        { default: qr } = await import(/* webpackChunkName: "qrcode" */ `../qrcode/qr-${file}.mjs`),
        { debounce } = await import('../common/debounce.mjs'),
        { loadFont } = await import('./fonts/loader.mjs'),
        { promisify } = await import('./index.mjs'),

        resolve = () => !browser ? Promise.resolve() : loadFont({ fontFamily }),
        catcher = () => {},

        QRCode = qr(fabric)

    fabric.QrCode = fabric.util.createClass(fabric.Object, {
        type: 'qr-code',

        hasRotatingPoint: false,
        lockScalingFlip: true,
        lockUniScaling: true,
        lockSkewingX: true,
        lockSkewingY: true,

        ...DEFAULT,

        initialize(options)
        {
            this.callSuper('initialize', options)

            browser && setControls(this, {
                tr: {
                    cursor: 'pointer',
                    action: () => {
                        this.stopFix = true
                        this.canvas.trigger('qrcode:settings', this)
                        setTimeout(() => {
                            this.stopFix = false
                        }, 100)
                    }
                }
            })
        },

        _render(ctx)
        {
            ctx.drawImage(this.context.canvas, -this.width / 2, -this.height / 2)
        }
    })

    /* fabric.QrCode.prototype.requestRender = (function(render) {
        let canvas = null

        return debounce(function() {
            this.canvas && (canvas = this.canvas)
            canvas && render.call(canvas)

        }, 0)
    })(fabric.Canvas.prototype.renderAll) */

    fabric.QrCode.prototype.onChangeFix = debounce(function() {
        if (this.stopFix || !this.canvas) {
            this.stopFix = false
            return
        }

        this.canvas.trigger('programmatic')

    }, 0)

    fabric.QrCode.prototype.toObject = (function(toObject) {
        return function(include = []) {
            const obj = this.originalTarget || this,
                keys = Object.keys(DEFAULT)

            return fabric.util.object.extend(
                toObject.call(obj, keys.concat(include)),
                keys.reduce((a, k) => ({ ...a, [k]: obj[k] }), {}),
                true
            )
        }
    })(fabric.QrCode.prototype.toObject)

    fabric.QrCode.fromObject = function(options, callback) {
        options.height -= 1.2 * options.title.fontSize

        resolve().catch(catcher).then(() => {
            const context = new QRCode(options)

            context.makeCode().draw().then(() => {
                callback(new fabric.QrCode({
                    ...Object.assign(options, { height: context.height }),
                    context
                }))
            })
        })
    }

    fabric.QrCode.create = function({ canvas: c }) {
        return resolve().catch(catcher).then(() => {
            const context = new QRCode(DEFAULT),
                z = c.getZoom(),

                cH = (c.height / z) + .5 | 0,
                cW = (c.width / z) + .5 | 0

            return context.makeCode().draw().then(() => {
                const height = context.height,
                    width = context.width,

                    top = (cH / 2) - height / 2,
                    left = (cW / 2) - width / 2

                return new fabric.QrCode({ context, height, width, left, top })
            })
        })
    }

    fabric.QrCode.async = true

    fabric.QrCode = promisify(fabric.QrCode, function(prop, val) {
        if (Object.keys(DEFAULT).includes(prop)) {
            if (prop === 'text') {
                this.context.makeCode(val)
            }

            this.context.draw()
            this.onChangeFix()
            fabric.request()
        }
    })

    return fabric
}
